import './header.scss';
import logo from '../images/logo.png';

export const Header = () => {
   return (
      <header className='header'>
         <div className='logo'>
            <img src={logo} alt='logo' />
            <p>Книжная лавка</p>
         </div>
         <navigator>
            <ul>
               <li>книги</li>
               <li>аудиокниги</li>
               <li>канцтовары и подарки</li>
               <li>Блог</li>

               

            </ul>
         </navigator>
      </header>
   )
}
